import { useLocation } from "react-router-dom"

export default function Breadcrumbs() {
  const location = useLocation()
  console.log(location)
  const currentLink = ''
  const crumbs = location.pathname.split('/')
        .filter(el => el !== '')
        .map(el => {
            currentLink += `/${crumbs}`
            return (
                <div className="crumb" key={el}></div>
            )
        })
  return (
    <div>Breadcrumbs</div>
  )
}
